    return(
        <div class="footer">
            <div class="footer-contents">
                <div class="left-side">
                    <img class=""src={pccmlogo} alt=""></img>
                </div>
                <div class="right-side">

                </div>
            </div>
        </div>
    );
}

export default Footer;
